import React from "react";

const logoStyle = {
	height: "8em",
	width: "8em"
};

export default class ChangingLogo extends React.Component {
	constructor(props) {
		super(props);
		this.state = props;
	}

	handleScroll() {
		var bottomBound = document.getElementById("changingLogo");
	}

	componentDidMount() {
		window.addEventListener("scroll", this.handleScroll);
	}

	determineLogo() {
		if (true) {
			return this.props.logo1;
		} else {
			return this.props.logo2;
		}
	}

	render() {
		return (
			<img
				id="changingLogo"
				src={this.determineLogo()}
				alt="Logo"
				style={logoStyle}
			/>
		);
	}
}
